var FlowchartDropDown={init:function(){var e=$("a.flowchartLink");var t=e.parent().next().next().next().next().next().next();for(var n=0,r=e.length;n<r;n++){$(e[n]).click(function(){var e=$(this).parent().next().next().next().next().next().next();if($(this).hasClass("active")){$(this).addClass("inactive");$(this).removeClass("active");e.addClass("hidden");e.removeClass("visible")}else{$(this).addClass("active");$(this).removeClass("inactive");e.addClass("visible");e.removeClass("hidden");var t=e.siblings(".visible");t.addClass("hidden");t.removeClass("visible");var n=t.prev().prev().prev().prev().prev().prev().children();n.addClass("inactive");n.removeClass("active")}})}}};FlowchartDropDown.init()